import React from "react";

const Searchbar = () => {
  const handleSubmit = (e) => {
    e.preventDefault();
  };
  return (
    <section>
      <form action="" className="search-form" onSubmit={handleSubmit}>
        <div>
          <img src="" alt="" />
          <input type="text" id="name" placeholder="Search for a country..." />
        </div>
      </form>
    </section>
  );
};

export default Searchbar;
